ERROR - 2025-01-31 13:22:02 --> Query error: ERROR:  invalid byte sequence for encoding "UTF8": 0xde 0x6e - Invalid query: INSERT INTO "sm_cppt" ("id_layanan_pendaftaran", "waktu", "id_profesi", "subject", "objective", "assessment", "plan", "ademi_assesment", "ademi_diag", "ademi_interv", "ademi_monev", "sbar_situation", "sbar_background", "sbar_assesment", "sbar_recommend", "id_nadis", "ttd_nadis", "instruksi_ppa", "id_dokter_dpjp", "id_user", "konsul_via_telp", "konsul", "created_date") VALUES ('680219', '2025-01-31 13:16', '18', 'Pasien mengatakan sesak, batuk, lemas', 'A: Jalan nafas paten. B: RR : 28 x/menit, terpasang nrm 15 Lpm, O2 Saturasi 99%, pengembangan dada simetris, Rhonki +/+ C: akral hangat nadi teraba kuat, CRT &lt;3 detik, TD : 128/63 mmHg (MAP 78 mmHg), Nadi 113 x/menit, terpasang IVFD NS 3%/24 Jam di taki No.22 di tgl 29/1/25 ,D: Kesadaran Compos mentis, GCS 15 E4M6V5, kekuatan otot 5/5/5/5. E: Suhu 36.5 C, Terpasang DC No 16 tgl 25/1/2025 Produksi urine (+) warna urin kuning, diuresis /kgbb/jam.Gds Jam 10 : 414', 'Gangguan Pertukaran gas, Ketidakstabilan kadar glukosa darah, intoleranasi aktifitas', 'Setelah dilakukan tindakan keperawatan 3x24 jam,Pertukaran gas meningkat dengan kriteria hasil Tingkat kesadaran meningkat,Dipsnea menurun,Pusing menurun,Penglihatan kabur menurun,Diaforesis menurun,Gelisah menurun,Nafas cuping hidung menurun,PCO2 membaik,PO2 membaik,setelah dilakukan tindakan keperawatan 3x24 jam Kestabilan kadar glukosa darah meningkat,Kriteria Hasil :Kesadran meningkat,Mengantuk menurun,Pusing menurun,Lelah/lesu menurun,Keluhan lapar menurun,Gemetar menurun,Berkeringat menurun,Mulut kering menurun,Rasa haus menurun,Kadar glukosa dalam darah membaik,Kadar glukosa dalam urine membaik,Setelah dilakukan tindakan keperawatan 3 x 24 jam toleransi Aktivitas Meningkat dengan kriteria hasil: Saturasi oksigen meningkat, Kemudahan dalam melakukan aktivitas sehari-hari meningkat, Keluhan lelah menurun, Dispnea saat beraktivitas menurun, Perasaan lemah menurun.
', '', '', '', '', '', '', '', '', '1629', '1', '<b>Intervensi mandiri</b><div>Monitor frekuensi, irama , kedalaman dan upaya nafas,Monitor pola nafas (seperti bradipnea, takipnea, hiperventilasi, kussmaul, cheyne-stokes, biot ataksik),Monitor kemampuan batuk epektif,Monitor adanya produksi sputum,Monitor adanya sumbatan jalan nafas,Palpasi kesimetrisan ekspansi paru.Auskultasi bunyi nafas.Monitor saturasi 0ksigen,Monitor nilai AGD,Identifikasi kemungknan penyebab hiperglikemia,identifikasi situasi yang emnyebabkan kebutuhan insulin meningkat, Monitor kadar glukosa darah, bila perlu,Monitor tanda dan gejala hiperglikemia (mis, polyuria, polifagia, kelemahan, malaise, pandangan kabur, atau sakit kepala),Monitor intake dan output cairan.</div><div><b>Intervensi kolaborasi:</b></div><div>- ro thorax tgl 2/1/25 di radiologi</div><div>- KGDH</div><div>- R/intubasi (-) sitm (+)</div><div>- ic kondisi tgl 25/1/25 (+)</div><div>- OAT start tgl 3/1/25</div><div>- px albumin tunggu hasil dr (+)</div><div>- R/ cek elektrolit post koresi (-)</div><div>- weaning oksigen, target oksigen 90ngan NK</div>', NULL, '1629', 0, NULL, '2025-01-31 13:22:02')
